import {useEffect, useState} from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.css';


function AddOwner()
{
    var [owner, setOwner] = useState([]);
    var [message, setMessage] = useState("");
    var [own, setOwn] = useState({owner_first_name:"",owner_last_name:"",owner_email:"",owner_password:"",owner_mobile:""});
    var [operation, setOperation] = useState("");
    var [searchText, setSearchText] = useState("");

    useEffect(()=>{
        Select();
    }, []);

    var TextChanged = function(args)
    {
        var copyOfOwner = {...owner};
        copyOfOwner[args.target.name] = args.target.value;
        setOwner(copyOfOwner);
    }

    var Select = function()
    {

        var helper = new XMLHttpRequest();


        helper.onreadystatechange =()=>{
            if(helper.readyState == 4 && helper.status == 200)
            {
                var result = JSON.parse(helper.responseText);
                setOwner(result.data);
            }
        }
        helper.open("GET", "http://localhost:4002/admin/viewowner");
        helper.send();
    }

    var Insert = function()
    {

    } 

    return(
        <>

        <table align='center'>
            <tbody>
                <tr>
                    <td>Owner_First_Name:</td>
                    <td>
                        <input type='text' name='owner_first_name' value={own.owner_first_name} onChange={TextChanged}></input>
                    </td>
                </tr>

                <tr>
                    <td>Owner_Last_Name:</td>
                    <td>
                        <input type='text' name='owner_last_name' value={own.owner_last_name} onChange={TextChanged}></input>
                    </td>
                </tr>

                <tr>
                    <td>Owner_Email:</td>
                    <td>
                        <input type='text' name='owner_email' value={own.owner_email} ></input>
                    </td>
                </tr>

                <tr>
                    <td>Owner_Password:</td>
                    <td>
                        <input type='text' name='owner_password' value={own.owner_password} ></input>
                    </td>
                </tr>

                <tr>
                    <td>Owner_Mobile:</td>
                    <td>
                        <input type='text' name='owner_mobile' value={own.owner_mobile} ></input>
                    </td>
                </tr>
                <tr >

                    <td align='center'><button  className='btn btn-success' onClick={Insert}>
                                    Add Record
                </button></td>

                </tr>
            </tbody>
        </table>






        <div className='table-responsive'>
            {message}
            <table className='table table-bordered'>
                <thead>
                    <th>owner_id</th>
                    <th>owner_first_name</th>
                    <th>owner_last_name</th>
                    <th>owner_email</th>
                    <th>owner_password</th>
                    <th>owner_mobile</th>
                </thead>
                <tbody>
                 {
                    owner.map((own)=>{
                        return <tr>
                            <td>{own.owner_id}</td>
                            <td>{own.owner_first_name}</td>
                            <td>{own.owner_last_name}</td>
                            <td>{own.owner_email}</td>
                            <td>{own.owner_password}</td>
                            <td>{own.owner_mobile}</td>

                    </tr>
                    })
                }
                </tbody>
            </table>

        </div>

        </>
    )
}

export default AddOwner;
